import './App.css';
import React, { useState } from 'react';

function isGreater(props) {
	return (
		<p>{props.num} is greater than 5.</p>
	);
}
function isEqual(props) {
	return (
		<p>{props.num} is greater than 5.</p>
	);
}
function isLess(props) {
	return (
		<p>{props.num} is greater than 5.</p>
	);
}


function App(props) {
	const [count, setCount] = useState(0);
  return (
    <div className="App">
	<nav className="nav-bar">
		<h1>{props.name} and React</h1>
	</nav>
	<div>
		<p className="display">Count: {count}</p>
		<button onClick={()=> setCount(count +1)}>
			Click me!
		</button>
	</div>

	<div>
		{count > 5 ?
			<isGreater num={count}/> :
			<isLess num={count}/>
		}
	</div>
    </div>
  );
}

export default App;
